INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (122, 'Find the Missing Number in an Array', 'Given an array of n-1 integers in the range 1 to n, find the missing number. The program calculates the sum of numbers from 1 to n and subtracts the sum of given numbers to find the missing one.', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-19 04:02:59.381101', 22, NULL, NULL, true, 'find-the-missing-number-in-an-array');
