INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (140, 'Check if a Number is an Armstrong Number', 'A number n is an Armstrong number if the sum of its digits raised to the power of the number of digits equals itself. Example: 153 = 1³ + 5³ + 3³', 'MEDIUM', 0.00, 0, 'PUBLIC', '2025-03-19 15:53:22.395172', 22, NULL, NULL, true, 'check-if-a-number-is-an-armstrong-number');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (116, 'Factorial of a Number', 'Compute the factorial of a given integer', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-19 02:30:51.397973', 22, NULL, NULL, true, 'factorial-of-a-number');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (141, 'Fibonacci Number', 'The Fibonacci numbers, commonly denoted F(n) form a sequence, called the Fibonacci sequence, such that each number is the sum of the two preceding ones, starting from 0 and 1. That is,


F(0) = 0, F(1) = 1
F(n) = F(n - 1) + F(n - 2), for n > 1.
Given n, calculate F(n).', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-19 16:02:12.358812', 22, NULL, NULL, true, 'fibonacci-number');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (149, 'Compute Square Root', 'Compute √x using binary search.', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-19 19:28:15.028814', 22, NULL, NULL, true, 'compute-square-root');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (150, 'Find Maximum Element in an Array Using Pointers', 'Write a program to find the largest element in an array using pointers.', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-19 19:39:49.544535', 22, NULL, NULL, true, 'find-maximum-element-in-an-array-using-pointers');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (162, 'The Sum Of The Sequence.', 'One of the basic problems to help you get familiar with the for loop.', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-20 04:55:37.048877', 22, NULL, NULL, true, 'the-sum-of-the-sequence');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (163, 'Sum Of Even Numbers.', 'Given a number n, calculate the sum of all even numbers from 0 to n.', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-20 05:02:13.264409', 22, NULL, NULL, true, 'sum-of-even-numbers');
