INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (134, 'String to Integer', 'Implement the myAtoi(string s) function, which converts a string to a 32-bit signed integer.

The algorithm for myAtoi(string s) is as follows:

Whitespace: Ignore any leading whitespace (" ").
Signedness: Determine the sign by checking if the next character is ''-'' or ''+'', assuming positivity if neither present.
Conversion: Read the integer by skipping leading zeros until a non-digit character is encountered or the end of the string is reached. If no digits were read, then the result is 0.
Rounding: If the integer is out of the 32-bit signed integer range [-231, 231 - 1], then round the integer to remain in the range. Specifically, integers less than -231 should be rounded to -231, and integers greater than 231 - 1 should be rounded to 231 - 1.
Return the integer as the final result.', 'MEDIUM', 0.00, 0, 'PUBLIC', '2025-03-19 07:38:50.772302', 22, NULL, NULL, true, 'string-to-integer');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (135, 'Count and Say', 'Run-length encoding (RLE) is a string compression method that works by replacing consecutive identical characters (repeated 2 or more times) with the concatenation of the character and the number marking the count of the characters (length of the run). For example, to compress the string "3322251" we replace "33" with "23", replace "222" with "32", replace "5" with "15" and replace "1" with "11". Thus the compressed string becomes "23321511".', 'MEDIUM', 0.00, 0, 'PUBLIC', '2025-03-19 07:52:22.302749', 22, NULL, NULL, true, 'count-and-say');
