Given the integer n, return the last number that remains in arr.

Example 1:

  Input: n = 9
  Output: 6
  Explanation:
  arr = [1, 2, 3, 4, 5, 6, 7, 8, 9]
  arr = [2, 4, 6, 8]
  arr = [2, 6]
