  Output: 1', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 10:58:45.174966', 22, NULL, NULL, true, 'elimination-game');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (272, 'Count Good Numbers', 'A digit string is good if the digits (0-indexed) at even indices are even and the digits at odd indices are prime (2, 3, 5, or 7).

For example, "2582" is good because the digits (2 and 8) at even positions are even and the digits (5 and 2) at odd positions are prime. However, "3245" is not good because 3 is at an even index but is not even. Given an integer n, return the total number of good digit strings of length n. Since the answer may be large, return it modulo 109 + 7.

A digit string is a string consisting of digits 0 through 9 that may contain leading zeros.

Example 1:
  Input: n = 1
  Output: 5
  Explanation: The good numbers of length 1 are "0", "2", "4", "6", "8".

Example 2:
  Input: n = 4
  Output: 400

Example 3:
  Input: n = 50
  Output: 564908303', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 11:07:04.726784', 22, NULL, NULL, true, 'count-good-numbers');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (273, 'Permutation Sequence', 'The set [1, 2, 3, ..., n] contains a total of n! unique permutations.

By listing and labeling all of the permutations in order, we get the following sequence for n = 3:

"123"
"132"
"213"
"231"
"312"
"321"
Given n and k, return the kth permutation sequence.

Example 1:
  Input: n = 3, k = 3
  Output: "213"

Example 2:
  Input: n = 4, k = 9
  Output: "2314"

Example 3:
  Input: n = 3, k = 1
  Output: "123"', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 11:39:03.645827', 22, NULL, NULL, true, 'permutation-sequence');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (274, 'Predict the Winner', 'You are given an integer array nums. Two players are playing a game with this array: player 1 and player 2.

Player 1 and player 2 take turns, with player 1 starting first. Both players start the game with a score of 0. At each turn, the player takes one of the numbers from either end of the array (i.e., nums[0] or nums[nums.length - 1]) which reduces the size of the array by 1. The player adds the chosen number to their score. The game ends when there are no more elements in the array.

Return true if Player 1 can win the game. If the scores of both players are equal, then player 1 is still the winner, and you should also return true. You may assume that both players are playing optimally.

Example 1:
  Input: nums = [1,5,2]
  Output: false
  Explanation: Initially, player 1 can choose between 1 and 2. If he chooses 2 (or 1), then player 2 can choose from 1 (or 2) and 5. If player 2 chooses 5, then player 1 will be left with 1 (or 2). So, final score of player 1 is 1 + 2 = 3, and player 2 is 5. Hence, player 1 will never be the winner and you need to return false.

Example 2:
  Input: nums = [1,5,233,7]
  Output: true
  Explanation: Player 1 first chooses 1. Then player 2 has to choose between 5 and 7. No matter which number player 2 choose, player 1 can choose 233. Finally, player 1 has more score (234) than player 2 (12), so you need to return True representing player1 can win.', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 11:47:18.138966', 22, NULL, NULL, true, 'predict-the-winner');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (275, 'Special Binary String', 'Special binary strings are binary strings with the following two properties:
  The number of 0''s is equal to the number of 1''s.
  Every prefix of the binary string has at least as many 1''s as 0''s.
You are given a special binary string s.

A move consists of choosing two consecutive, non-empty, special substrings of s, and swapping them. Two strings are consecutive if the last character of the first string is exactly one index before the first character of the second string.

Return the lexicographically largest resulting string possible after applying the mentioned operations on the string.

Example 1:
  Input: s = "11011000"
  Output: "11100100"
  Explanation: The strings "10" [occuring at s[1]] and "1100" [at s[3]] are swapped. This is the lexicographically largest string possible after some number of swaps.

Example 2:
  Input: s = "10"
  Output: "10"', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 11:55:13.642153', 22, NULL, NULL, true, 'special-binary-string');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (277, 'Maximize Number of Nice Divisors', 'You are given a positive integer primeFactors. You are asked to construct a positive integer n that satisfies the following conditions:

The number of prime factors of n (not necessarily distinct) is at most primeFactors.
The number of nice divisors of n is maximized. Note that a divisor of n is nice if it is divisible by every prime factor of n. For example, if n = 12, then its prime factors are [2,2,3], then 6 and 12 are nice divisors, while 3 and 4 are not.
Return the number of nice divisors of n. Since that number can be too large, return it modulo 109 + 7.

Note that a prime number is a natural number greater than 1 that is not a product of two smaller natural numbers. The prime factors of a number n is a list of prime numbers such that their product equals n.', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 12:10:17.484218', 22, NULL, NULL, true, 'maximize-number-of-nice-divisors');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (276, 'Integer to English Words', 'Convert a non-negative integer num to its English words representation.

Example 1:
  Input: num = 123
  Output: "One Hundred Twenty Three"

Example 2:
  Input: num = 12345
  Output: "Twelve Thousand Three Hundred Forty Five"

Example 3:
  Input: num = 1234567
  Output: "One Million Two Hundred Thirty Four Thousand Five Hundred Sixty Seven"', 'HARD', 100.00, 1, 'PRIVATE', '2025-03-23 12:04:40.442404', 22, NULL, NULL, true, 'integer-to-english-words');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (279, 'K-th Symbol in Grammar', 'We build a table of n rows (1-indexed). We start by writing 0 in the 1st row. Now in every subsequent row, we look at the previous row and replace each occurrence of 0 with 01, and each occurrence of 1 with 10.
  For example, for n = 3, the 1st row is 0, the 2nd row is 01, and the 3rd row is 0110.
Given two integer n and k, return the kth (1-indexed) symbol in the nth row of a table of n rows.

Example 1:
  Input: n = 1, k = 1
  Output: 0
  Explanation: row 1: 0

Example 2:
  Input: n = 2, k = 1
  Output: 0
  Explanation: 
  row 1: 0
  row 2: 01

Example 3:
  Input: n = 2, k = 2
  Output: 1
  Explanation: 
  row 1: 0
  row 2: 01', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 16:42:44.947502', 22, NULL, NULL, true, 'kth-symbol-in-grammar');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (280, 'Count Collisions of Monkeys on a Polygon', 'There is a regular convex polygon with n vertices. The vertices are labeled from 0 to n - 1 in a clockwise direction, and each vertex has exactly one monkey. Simultaneously, each monkey moves to a neighboring vertex. A collision happens if at least two monkeys reside on the same vertex after the movement or intersect on an edge.
Return the number of ways the monkeys can move so that at least one collision happens. Since the answer may be very large, return it modulo 10^9 + 7.

Example 1:
  Input: n = 3
  Output: 6
  Explanation: There are 8 total possible movements. Two ways such that they collide at some point are: Monkey 1 moves in a clockwise direction; monkey 2 moves in an anticlockwise direction; monkey 3 moves in a clockwise direction. Monkeys 1 and 2 collide. Monkey 1 moves in an anticlockwise direction; monkey 2 moves in an anticlockwise direction; monkey 3 moves in a clockwise direction. Monkeys 1 and 3 collide.

Example 2:
  Input: n = 4
  Output: 14', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 17:03:49.73826', 22, NULL, NULL, true, 'count-collisions-of-monkeys-on-a-polygon');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (281, 'Unique 3-Digit Even Numbers', 'You are given an array of digits called digits. Your task is to determine the number of distinct three-digit even numbers that can be formed using these digits.
Note: Each copy of a digit can only be used once per number, and there may not be leading zeros.

Example 1:
  Input: digits = [1,2,3,4]
  Output: 12
  Explanation: The 12 distinct 3-digit even numbers that can be formed are 124, 132, 134, 142, 214, 234, 312, 314, 324, 342, 412, and 432. Note that 222 cannot be formed because there is only 1 copy of the digit 2.

Example 2:
  Input: digits = [0,2,2]
  Output: 2
  Explanation: The only 3-digit even numbers that can be formed are 202 and 220. Note that the digit 2 can be used twice because it appears twice in the array.

Example 3:
  Input: digits = [6,6,6]
  Output: 1
  Explanation: Only 666 can be formed.

Example 4:
  Input: digits = [1,3,5]
  Output: 0
  Explanation: No even 3-digit numbers can be formed.', 'MEDIUM', 0.00, 0, 'PUBLIC', '2025-03-23 17:10:39.98647', 22, NULL, NULL, true, 'nique-3digit-even-numbers');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (283, 'Decode Ways', 'You have intercepted a secret message encoded as a string of numbers. The message is decoded via the following mapping:

"1" -> ''A''
"2" -> ''B''
...
"25" -> ''Y''
"26" -> ''Z''

However, while decoding the message, you realize that there are many different ways you can decode the message because some codes are contained in other codes ("2" and "5" vs "25").

For example, "11106" can be decoded into:

"AAJF" with the grouping (1, 1, 10, 6)
"KJF" with the grouping (11, 10, 6)
The grouping (1, 11, 06) is invalid because "06" is not a valid code (only "6" is valid).
Note: there may be strings that are impossible to decode.

Given a string s containing only digits, return the number of ways to decode it. If the entire string cannot be decoded in any valid way, return 0.

The test cases are generated so that the answer fits in a 32-bit integer.

Example 1:

Input: s = "12"

Output: 2

Explanation:

"12" could be decoded as "AB" (1 2) or "L" (12).

Example 2:

Input: s = "226"

Output: 3

Explanation:

"226" could be decoded as "BZ" (2 26), "VF" (22 6), or "BBF" (2 2 6).

Example 3:

Input: s = "06"

Output: 0

Explanation:

"06" cannot be mapped to "F" because of the leading zero ("6" is different from "06"). In this case, the string is not a valid encoding, so return 0.', 'HARD', 0.00, 0, 'PUBLIC', '2025-03-23 21:17:31.210231', 22, NULL, NULL, true, 'decode-ways');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (278, 'Decode String', 'Given an encoded string, return its decoded string.

The encoding rule is: k[encoded_string], where the encoded_string inside the square brackets is being repeated exactly k times. Note that k is guaranteed to be a positive integer.

You may assume that the input string is always valid; there are no extra white spaces, square brackets are well-formed, etc. Furthermore, you may assume that the original data does not contain any digits and that digits are only for those repeat numbers, k. For example, there will not be input like 3a or 2[4].

The test cases are generated so that the length of the output will never exceed 105.

Example 1:
  Input: s = "3[a]2[bc]"
  Output: "aaabcbc"

Example 2:
  Input: s = "3[a2[c]]"
  Output: "accaccacc"

Example 3:

  Input: s = "2[abc]3[cd]ef"

  Output: "abcabccdcdcdef"', 'HARD', 100.00, 1, 'PRIVATE', '2025-03-23 16:36:27.264669', 22, NULL, NULL, true, 'decode-string');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (282, 'Unique Paths', 'There is a robot on an m x n grid. The robot is initially located at the top-left corner (i.e., grid[0][0]). The robot tries to move to the bottom-right corner (i.e., grid[m - 1][n - 1]). The robot can only move either down or right at any point in time.

Given the two integers m and n, return the number of possible unique paths that the robot can take to reach the bottom-right corner.

The test cases are generated so that the answer will be less than or equal to 2 * 109.', 'HARD', 100.00, 1, 'PRIVATE', '2025-03-23 17:17:17.356203', 22, NULL, NULL, true, 'unique-paths');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (284, 'Reverse String II', 'Write a function that takes a string as input and returns the string in reverse order.', 'HARD', 100.00, 1, 'PUBLIC', '2025-03-23 21:21:57.956838', 22, '2025-03-23 21:58:33.695065', 22, true, 'reverse-string-ii');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (285, 'Double Array', 'Write a function that takes an array of integers as input and returns a new array where each element is doubled.', 'HARD', 100.00, 1, 'PUBLIC', '2025-03-23 21:27:21.387969', 22, NULL, NULL, true, 'double-array');
INSERT INTO schema_problem.problem OVERRIDING SYSTEM VALUE VALUES (286, 'Append AI', 'Write a function that takes an array of strings as input and returns a new array where each element has the suffix "AI" added.', 'EASY', 0.00, 0, 'PUBLIC', '2025-03-23 21:46:07.786496', 22, '2025-03-23 22:16:50.054212', 22, true, 'append-ai');


