INSERT INTO schema_problem.problem_submission OVERRIDING SYSTEM VALUE VALUES (215, 1, 112, '    public static int canCompleteCircuit(int[] gas, int[] cost) {
        int len = gas.length;
        int[] diff = new int[len];
        int to = 0;
        for (int i = 0; i < len; i++) {
            diff[i] += (gas[i] - cost[i]);
            to += diff[i];
        }
        if (to < 0) {
            return -1;
        }
        int index = 0;
        to = 0;
        for (int i = 0; i < len; i++) {
            to += diff[i];
            if (to < 0) {
                index = i + 1;
                to = 0;
            }
        }
        return index;
    }', 1, NULL, 1.97, 5, '2025-03-07 08:00:41.849753', true, NULL, NULL, 2, 'SUCCESS');
INSERT INTO schema_problem.problem_submission OVERRIDING SYSTEM VALUE VALUES (240, 1, 278, '//Function
public static String decodeString(String s) {
  String decoded = s;
  StringBuilder sb = new StringBuilder();
  int check, start = 0, end = 0, num = 0, check2, p = 0;
  while(true) {
    sb.delete(0, sb.length());
    check = 0;
    check2 = 0;
    for(int i = 0; i < decoded.length(); i ++ ) {
      if(decoded.charAt(i) == ''['') {
        if(check == 0) {
          p = i - 1;
          while(p >= 0 && decoded.charAt(p) >= 48 && decoded.charAt(p) <= 57) {
            p --;
          }
          num = Integer.parseInt(decoded.substring(p + 1, i));
          start = i;
        }
        check ++;
        check2 ++;
      }
      if(decoded.charAt(i) == '']'') {
        check --;
        if(check == 0) {
          end = i;
          if(start != 1) {
            if(p >= 0) {
              sb.append(decoded.substring(0, p + 1));
            }
          }
          for(int j = 0; j < num; j ++ ) {
            sb.append(decoded.substring(start + 1, end));
          }
          sb.append(decoded.substring(end + 1));
          decoded = sb.toString();
          break;
        }
      }
    }
    if(check2 == 0) {
      break;
    }
  }
  return decoded;
}', 1, NULL, 2.1, 6, '2025-03-23 19:11:04.870112', true, NULL, NULL, 10, 'SUCCESS');
