int isValid(char* s) {
    char stack[10000];
    int top = -1;
    for (int i = 0; s[i] != ''\0''; i++) {
        char c = s[i];
        if (c == ''('' || c == ''{'' || c == ''['') {
            stack[++top] = c;
        } else {
            if (top == -1) return 0;
            char topChar = stack[top--];
            if ((c == '')'' && topChar != ''('') ||
                (c == ''}'' && topChar != ''{'') ||
                (c == '']'' && topChar != ''['')) {
                return 0;
            }
        }
    }
    return top == -1;
}', NULL);
