INSERT INTO schema_problem.solution_code VALUES (221, 142, 2, '
    int findMinFibonacciNumbers(int k) {
        long long a = 1, b = 1, temp, count = 0;

        while (b <= k) {
            temp = a + b;
            a = b;
            b = temp;
        }

        while (k > 0) {
            if (a <= k) {
                k -= a;
                count++;
            }

            temp = b - a;
            b = a;
            a = temp;
        }

        return count;
    }', NULL);
