INSERT INTO schema_problem.solution_code VALUES (282, 203, 1, '
    public static int[] removeElement(int[] arr, int target) {
        int index = -1;
        for (int i = 0; i < arr.length; i++) {
            if (arr[i] == target) {
                index = i;
                break;
            }
        }
        if (index == -1) return arr;

        int[] newArr = new int[arr.length - 1];
        for (int i = 0, j = 0; i < arr.length; i++) {
            if (i != index) newArr[j++] = arr[i];
        }
        return newArr;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (282, 203, 2, '
