        for (int i = 0; i < size; i++) {
            if (arr[i] == target) {
                index = i;
                break;
            }
        }
        if (index == -1) return;

        for (int i = index; i < size - 1; i++) {
            arr[i] = arr[i + 1];
        }
        return arr;
    }', NULL);
