INSERT INTO schema_problem.solution_code VALUES (285, 206, 1, '
    public static int mostFrequent(int[] arr) {
        Map<Integer, Integer> freqMap = new HashMap<>();
        for (int num : arr) {
            freqMap.put(num, freqMap.getOrDefault(num, 0) + 1);
        }

        int maxCount = 0, mostFreqNum = Integer.MAX_VALUE;
        for (Map.Entry<Integer, Integer> entry : freqMap.entrySet()) {
            if (entry.getValue() > maxCount || (entry.getValue() == maxCount && entry.getKey() < mostFreqNum)) {
                maxCount = entry.getValue();
                mostFreqNum = entry.getKey();
            }
        }
        return mostFreqNum;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (285, 206, 2, '
