            for (int j = i + 1; j < size; j++) {
                if (arr[i] == arr[j]) count++;
            }

            if (count > maxCount || (count == maxCount && arr[i] < mostFreqNum)) {
                maxCount = count;
                mostFreqNum = arr[i];
            }
        }
        return mostFreqNum;
    }', NULL);
