INSERT INTO schema_problem.solution_code VALUES (287, 208, 2, '
    int* mergeAndSort(int arr1[], int size1, int arr2[], int size2) {
        int size = size1 + size2;
        int merged[size];

        for (int i = 0; i < size1; i++) merged[i] = arr1[i];
        for (int i = 0; i < size2; i++) merged[size1 + i] = arr2[i];

        for (int i = 0; i < size - 1; i++) {
            for (int j = i + 1; j < size; j++) {
                if (merged[i] > merged[j]) {
                    int temp = merged[i];
                    merged[i] = merged[j];
                    merged[j] = temp;
                }
            }
        }

        return merged;
    }', NULL);
