INSERT INTO schema_problem.solution_code VALUES (300, 221, 1, '
    public static int maxPathSum(int[][] grid) {
        int n = grid.length;
        int[][] dp = new int[n][n];

        dp[0][0] = grid[0][0];
        for (int i = 1; i < n; i++) dp[i][0] = dp[i - 1][0] + grid[i][0];
        for (int j = 1; j < n; j++) dp[0][j] = dp[0][j - 1] + grid[0][j];

        for (int i = 1; i < n; i++) {
            for (int j = 1; j < n; j++) {
                dp[i][j] = Math.max(dp[i - 1][j], dp[i][j - 1]) + grid[i][j];
            }
        }
        return dp[n - 1][n - 1];
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (300, 221, 2, '
    int maxPathSum(int n, int grid[n][n]) {
        int dp[n][n];

        dp[0][0] = grid[0][0];
        for (int i = 1; i < n; i++) dp[i][0] = dp[i - 1][0] + grid[i][0];
        for (int j = 1; j < n; j++) dp[0][j] = dp[0][j - 1] + grid[0][j];

        for (int i = 1; i < n; i++) {
            for (int j = 1; j < n; j++) {
                dp[i][j] = (dp[i - 1][j] > dp[i][j - 1] ? dp[i - 1][j] : dp[i][j - 1]) + grid[i][j];
            }
        }
        return dp[n - 1][n - 1];
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (339, 260, 1, '
    public static int[] findNSE(int[] arr) {
        Stack<Integer> stack = new Stack<>();
        int[] result = new int[arr.length];

        for (int i = 0; i < arr.length; i++) {
            while (!stack.isEmpty() && stack.peek() >= arr[i]) {
                stack.pop();
            }
            result[i] = stack.isEmpty() ? -1 : stack.peek();
            stack.push(arr[i]);
        }
        return result;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (301, 222, 1, '
    public static int maxSquareSize(int[][] matrix) {
        int m = matrix.length, n = matrix[0].length;
        int maxSize = 0;
        int[][] dp = new int[m][n];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (i == 0 || j == 0) dp[i][j] = matrix[i][j];
                else if (matrix[i][j] == 1) 
                    dp[i][j] = Math.min(dp[i - 1][j], Math.min(dp[i][j - 1], dp[i - 1][j - 1])) + 1;

                maxSize = Math.max(maxSize, dp[i][j]);
            }
        }
        return maxSize;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (302, 223, 1, '
    static class Point {
        int x, y, dist;
        Point(int x, int y, int dist) { this.x = x; this.y = y; this.dist = dist; }
    }

    public static int shortestPath(int[][] maze) {
        int n = maze.length;
        if (maze[0][0] == 1 || maze[n - 1][n - 1] == 1) return -1;

        int[] dx = {-1, 1, 0, 0}, dy = {0, 0, -1, 1};
        Queue<Point> q = new LinkedList<>();
        boolean[][] visited = new boolean[n][n];

        q.add(new Point(0, 0, 1));
        visited[0][0] = true;

        while (!q.isEmpty()) {
            Point p = q.poll();
            if (p.x == n - 1 && p.y == n - 1) return p.dist;

            for (int i = 0; i < 4; i++) {
                int nx = p.x + dx[i], ny = p.y + dy[i];
                if (nx >= 0 && ny >= 0 && nx < n && ny < n && maze[nx][ny] == 0 && !visited[nx][ny]) {
                    visited[nx][ny] = true;
                    q.add(new Point(nx, ny, p.dist + 1));
                }
            }
        }
        return -1;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (303, 224, 1, '
    public static void dfs(int[][] grid, int i, int j) {
        if (i < 0 || j < 0 || i >= grid.length || j >= grid[0].length || grid[i][j] == 0) return;
        grid[i][j] = 0; 
        dfs(grid, i - 1, j);
        dfs(grid, i + 1, j);
        dfs(grid, i, j - 1);
        dfs(grid, i, j + 1);
    }

    public static int countIslands(int[][] grid) {
        int count = 0;
        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                if (grid[i][j] == 1) {
                    count++;
                    dfs(grid, i, j);
                }
            }
        }
        return count;
    }', NULL);
