INSERT INTO schema_problem.solution_code VALUES (313, 234, 1, '
    public static int[] findClosestPair(List<Integer> list, int n) {
        Collections.sort(list);
        int left = 0, right = list.size() - 1;
        int closestSum = Integer.MAX_VALUE, num1 = 0, num2 = 0;

        while (left < right) {
            int sum = list.get(left) + list.get(right);
            if (Math.abs(sum - n) < Math.abs(closestSum - n)) {
                closestSum = sum;
                num1 = list.get(left);
                num2 = list.get(right);
            }

            if (sum < n) left++;
            else right--;
        }
        return new int[]{num1, num2};
    }', NULL);
