INSERT INTO schema_problem.solution_code VALUES (324, 245, 1, '
    public static int longestConsecutiveSequence(List<Integer> list) {
        Set<Integer> numSet = new HashSet<>(list);
        int longestStreak = 0;

        for (int num : numSet) {
            if (!numSet.contains(num - 1)) {  
                int currentNum = num;
                int currentStreak = 1;

                while (numSet.contains(currentNum + 1)) {
                    currentNum++;
                    currentStreak++;
                }

                longestStreak = Math.max(longestStreak, currentStreak);
            }
        }
        return longestStreak;
    }', NULL);
