INSERT INTO schema_problem.solution_code VALUES (342, 263, 1, '
    public static boolean isPalindrome(String str) {
        Queue<Character> queue = new LinkedList<>();
        Stack<Character> stack = new Stack<>();

        for (char ch : str.toCharArray()) {
            queue.offer(ch);
            stack.push(ch);
        }

        while (!queue.isEmpty()) {
            if (!queue.poll().equals(stack.pop())) {
                return false;
            }
        }
        return true;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (343, 264, 1, '
    public static List generateBinary(int n) {
        List<String> result = new ArrayList<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer("1");

        for (int i = 0; i < n; i++) {
            String binary = queue.poll();
            result.add(binary);
            queue.offer(binary + "0");
            queue.offer(binary + "1");
        }
        return result;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (344, 265, 1, '
    public static int[] maxSlidingWindow(int[] nums, int k) {
        int n = nums.length;
        int[] result = new int[n - k + 1];
        Deque<Integer> deque = new LinkedList<>();

        for (int i = 0; i < n; i++) {
            while (!deque.isEmpty() && deque.peekFirst() < i - k + 1) {
                deque.pollFirst();
            }
            while (!deque.isEmpty() && nums[deque.peekLast()] < nums[i]) {
                deque.pollLast();
            }
            deque.offerLast(i);
            if (i >= k - 1) {
                result[i - k + 1] = nums[deque.peekFirst()];
            }
        }
        return result;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (345, 266, 1, '
    public static int minCheckoutTime(int[] customers, int K) {
        PriorityQueue<Integer> pq = new PriorityQueue<>();
        for (int i = 0; i < K; i++) pq.offer(0);

        for (int c : customers) {
            pq.offer(pq.poll() + c);
        }

        int maxTime = 0;
        while (!pq.isEmpty()) {
            maxTime = Math.max(maxTime, pq.poll());
        }
        return maxTime;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (346, 267, 1, '
    public static int roundRobin(int[] processes, int quantum) {
        Queue<Integer> queue = new LinkedList<>();
        for (int p : processes) queue.offer(p);

        int time = 0;
        while (!queue.isEmpty()) {
            int p = queue.poll();
            if (p > quantum) {
                time += quantum;
                queue.offer(p - quantum);
            } else {
                time += p;
            }
        }
        return time;
    }', NULL);
