INSERT INTO schema_problem.solution_code VALUES (348, 269, 1, '
    public static int countDigitOne(int n) {
        if (n <= 0)
            return 0;
        int q = n, x = 1, ans = 0;
        do {
            int digit = q % 10;
            q /= 10;
            ans += q * x;
            if (digit == 1)
                ans += n % x + 1;
            if (digit > 1)
                ans += x;
            x *= 10;
        } while (q > 0);
        return ans;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (349, 270, 1, '
    public static int calculate(String s) {
        int number = 0;
        int signValue = 1;
        int result = 0;
        Stack<Integer> operationsStack = new Stack<>();

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);

            if (Character.isDigit(c)) {
                number = number * 10 + (c - ''0'');
            } else if (c == ''+'' || c == ''-'') {
                result += number * signValue;
                signValue = (c == ''-'') ? -1 : 1;
                number = 0;
            } else if (c == ''('') {
                operationsStack.push(result);
                operationsStack.push(signValue);
                result = 0;
                signValue = 1;
            } else if (c == '')'') {
                result += signValue * number;
                result *= operationsStack.pop();
                result += operationsStack.pop();
                number = 0;
            }
        }

        return result + number * signValue;
    }', NULL);
