INSERT INTO schema_problem.solution_code VALUES (352, 273, 1, '
    public static String getPermutation(int n, int k) {
        List<Integer> num = new LinkedList<Integer>();
        for (int i = 1; i <= n; i++) num.add(i);
        int[] fact = new int[n];  
        fact[0] = 1;
        for (int i = 1; i < n; i++) fact[i] = i*fact[i-1];
        k = k-1;
        StringBuilder sb = new StringBuilder();
        for (int i = n; i > 0; i--){
            int ind = k/fact[i-1];
            k = k%fact[i-1];
            sb.append(num.get(ind));
            num.remove(ind);
        }
        return sb.toString();
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (353, 274, 1, '
    static int n;
    public static boolean predictTheWinner(int[] nums) {
        n = nums.length;
        int[][] dp = new int[23][23];
        for(int[] arr:dp){
            Arrays.fill(arr, -1);
        }
        int totalSum = 0;
        for(int num : nums){
            totalSum+=num;
        }
        int first = solve(0, n-1, totalSum, nums, dp);
        int second = totalSum-first;

        if(first>=second) return true;
        else{return false;}

    }
    static int solve(int i, int j, int total, int[] nums, int[][]dp){
        if(i>j) return 0;
        if(i==j) return nums[i];

        if(dp[i][j] != -1) return dp[i][j];

        int take_i = nums[i]+ Math.min(solve(i+2, j, total, nums, dp) , solve(i+1, j-1, total, nums, dp));
        int take_j = nums[j]+ Math.min(solve(i+1, j-1, total, nums, dp) , solve(i, j-2, total, nums, dp));

        return dp[i][j]=  Math.max(take_i, take_j);
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (354, 275, 1, '
    public static String makeLargestSpecial(String S) {
        int count = 0, i = 0;
        List<String> res = new ArrayList<String>();
        for (int j = 0; j < S.length(); ++j) {
          if (S.charAt(j) == ''1'') count++;
          else count--;
          if (count == 0) {
            res.add(''1'' + makeLargestSpecial(S.substring(i + 1, j)) + ''0'');
            i = j + 1;
          }
        }
        Collections.sort(res, Collections.reverseOrder());
        return String.join("", res);
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (355, 276, 1, '
    public static final String[] belowTen = new String[] {"", "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"};
    public static final String[] belowTwenty = new String[] {"Ten", "Eleven", "Twelve", "Thirteen", "Fourteen", "Fifteen", "Sixteen", "Seventeen", "Eighteen", "Nineteen"};
    public static final String[] belowHundred = new String[] {"", "Ten", "Twenty", "Thirty", "Forty", "Fifty", "Sixty", "Seventy", "Eighty", "Ninety"};

    public static String numberToWords(int num) {
        if (num == 0) return "Zero";
        return helper(num); 
    }

    public static String helper(int num) {
        String result = new String();
        if (num < 10) result = belowTen[num];
        else if (num < 20) result = belowTwenty[num -10];
        else if (num < 100) result = belowHundred[num/10] + " " + helper(num % 10);
        else if (num < 1000) result = helper(num/100) + " Hundred " +  helper(num % 100);
        else if (num < 1000000) result = helper(num/1000) + " Thousand " +  helper(num % 1000);
        else if (num < 1000000000) result = helper(num/1000000) + " Million " +  helper(num % 1000000);
        else result = helper(num/1000000000) + " Billion " + helper(num % 1000000000);
        return result.trim();
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (356, 277, 1, '
    public static long mod = 1000000007;

    public static long pow(long n) {
        if (n == 0)

            return 1;
        long half = pow(n / 2);
        if (n % 2 == 0)
            return (half * half) % mod;
        return (3 * half * half) % mod;
    }

    public static int maxNiceDivisors(int n) {
        if (n < 5)
            return n;
        if (n % 3 == 0)
            return (int) pow(n / 3);
        if (n % 3 == 1)
            return (int) ((pow(n / 3 - 1) * 4) % mod);
        return (int) ((pow(n / 3) * 2) % mod);
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (357, 278, 1, '
    public static String decodeString(String s) {
        String decoded = s;
        StringBuilder sb = new StringBuilder();
        int check, start = 0, end = 0, num = 0, check2, p = 0;
        while(true) {
            sb.delete(0, sb.length());
            check = 0;
            check2 = 0;
            for (int i = 0; i < decoded.length(); i++) {
                if(decoded.charAt(i) == ''['') {
                    if(check == 0) {
                        p = i - 1;
                        while(p >= 0 && decoded.charAt(p) >= 48 && decoded.charAt(p) <= 57) {
                            p--;
                        }
                        num = Integer.parseInt(decoded.substring(p + 1, i));
                        start = i;
                    }
                    check++;
                    check2++;
                }
                if(decoded.charAt(i) == '']'') {
                    check--;
                    if(check == 0) {
                        end = i;
                        if(start != 1) {
                            if(p >= 0) {
                                sb.append(decoded.substring(0, p + 1));
                            }

                        }
                        for (int j = 0; j < num; j++) {
                            sb.append(decoded.substring(start + 1, end));
                        }
                        sb.append(decoded.substring(end + 1));
                        decoded = sb.toString();
                        break;
                    }
                }
            }
            if(check2 == 0) {
                break;
            }
        }

        return decoded;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (358, 279, 1, '
    public static int kthGrammar(int n, int k) {
        boolean areValuesSame = true;

        n = (int) Math.pow(2, n - 1);

        while (n != 1) {
            n /= 2;

            if (k > n) {
                k -= n;
                areValuesSame = !areValuesSame;
            }
        }

        return (areValuesSame ? 0 : 1);
    }', NULL);
