INSERT INTO schema_problem.solution_code VALUES (360, 281, 1, '
    public static int totalNumbers(int[] digits) {
        HashSet<Integer> set = new HashSet<>();
        int n = digits.length;
        for (int i = 0; i < n; i++) {
            if (digits[i] == 0) continue;
            for (int j = 0; j < n; j++) {
                if (j == i) continue;
                for (int k = 0; k < n; k++) {
                    if (k == i || k == j) continue;
                    if (digits[k] % 2 == 0) {
                        int number = digits[i] * 100 + digits[j] * 10 + digits[k];
                        set.add(number);
                    }
                }
            }
        }
        return set.size();
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (361, 282, 1, '
    public static int uniquePaths(int m, int n) {
        int total = m+n-2;
        int a = Math.min(n-1,m-1);
        long result = 1;

        for(int i=0;i<a;i++){
            result = result * (total-i)/(i+1);
        }
        return (int) result;
    }', NULL);
INSERT INTO schema_problem.solution_code VALUES (362, 283, 1, '
